import React from 'react';
import ReactDOM from 'react-dom';
import { useState } from 'react';
import $ from 'jquery';
import './style.css';

function Frame(type) {
  const [lists, setLists] = useState([
    { title: '1', text: '1'},
    { title: '2', text: '1'},
    { title: '3', text: '1'},
    { title: '4', text: '1'},
    { title: '5', text: '1'},
    { title: '6', text: '1'},
    { title: '7', text: '1'},
  ]);
  const div = (
    <div id={type}>
      {lists.map(x => {
        const title = x.title;
        const text = x.text;
        const key = x.title;
        return List({title, text})
      })}
    </div>
  )
  return div;
}

function List({title, text}) {
  return (
    <div>
      <h1>{title}</h1>
      <ul>{text}</ul>
    </div>
  )
}

function Task(type) {
  return <li>task</li>
}

function init() {
  ReactDOM.render(<Frame type='river'/>, $('#root')[0]);
  ReactDOM.render(<Frame type='bank'/>, $('#root')[0]);
}

init();
